//Grading.java
class Grading{
  int passMark;
  Grading(int passMark){
    this.passMark=passMark;
  }
  void setPassMark(int mark){
    this.passMark=mark;
  }
  int getPassMark(){
    return passMark;
  }
  String toLetterGrade(int score){
    if(score>=80){
      return "A";
    }else if(score>=70){
      return "B";
    }else if(score>=60){
      return "C";
    }else if(score>=50){
      return "D";
    }else if(score>=1){
      return "E";
    }else{
      return "X";
    }
  }
  double calculateAvg(int[] grades){
    double sum=0.0;
    int zeroes=0;
    for(int i=0;i<grades.length;i++){
      if(grades[i]>0)sum+=grades[i];
      else zeroes++;
    }
    return sum/(grades.length-zeroes);
  }
  String summerizeGrade(int[] grades){
    double avg=calculateAvg(grades);
    int pass=0,fail=0;
    for(int i=0;i<grades.length;i++){
      if(grades[i]>=passMark)pass++;
      else fail++;
    }
    String s="";
    for(int i=0;i<grades.length;i++){
      s+=" ";
      s+=toLetterGrade(grades[i]);
    }
    return "Avg. Score: "+avg+"\nPass: "+pass+", Fail: "+fail+"\nAll Grades Letter:"+s+"\n";
  }
}

//Student.java
class Student{
  String name;
  int[] grades;
  int gradesIndex;
  Student(String name){
    this.name=name;
    this.grades=new int[5];
    this.gradesIndex=0;
  }
  String getName(){
    return name;
  }
  int getGrade(int idx){
    return grades[idx];
  }
  int[] getGrades(){
    return grades;
  }
  void setName(String name){
    this.name=name;
  }
  void setGrade(int idx,int grade){
    grades[idx]=grade;
  }
  void addGrade(int grade){
    if(gradesIndex<5)grades[gradesIndex++]+=grade;
    else System.out.println("Array index out of bounds.");
  }
  String info(){
    return String.format("Name: %s\nGrades: %d %d %d %d %d\n",name,grades[0],grades[1],grades[2],grades[3],grades[4]);
  }
}

