void circle(GLfloat rx, GLfloat ry, GLfloat cx, GLfloat cy)
{
    glBegin(GL_POLYGON);
    glVertex2f(cx, cy);
    for (int i = 0; i <= 360; i++)
    {
        float angle = i * 3.1416 / 180;
        float x = rx * cos(angle);
        float y = ry * sin(angle);
        glVertex2f((x + cx), (y + cy));
    }
    glEnd();
}

float shift = 0; // a variable used to move the boat right and left

void init(void)
{
    glClearColor(0.0, 0.9, 0.9, 0.0);
    glMatrixMode(GL_PROJECTION);
    gluOrtho2D(0, 500, 0, 500);
}

float cloudY = 10;

void clouds()
{
    glPushMatrix();
    // 1st cloud
    glColor3ub(255, 255, 255);

    circle(20, 30, 445, cloudY + 10);

    circle(15, 20, 420, cloudY + 10);

    circle(15, 20, 475, cloudY + 10);

    // 2nd cloud
    circle(20, 30, 390, cloudY + 50);

    circle(15, 20, 405, cloudY + 50);

    circle(15, 20, 375, cloudY + 50);

    glPopMatrix();
    cloudY += 0.05;
    if (cloudY > 500)
        cloudY = -50;
    glutPostRedisplay();
}

void display(void)
{
    glClear(GL_COLOR_BUFFER_BIT);

    //River Color
    glColor3ub(0, 191, 255);
    glBegin(GL_POLYGON);
    glVertex2d(0, 0);
    glVertex2d(500, 0);
    glVertex2d(500, 300);
    glVertex2d(0, 300);
    glEnd();

    // Boat design
    glColor3ub(0, 0, 0);
    glBegin(GL_POLYGON);
    glVertex2d(325 + shift, 220);
    glVertex2d(400 + shift, 220);
    glVertex2d(425 + shift, 250);
    glVertex2d(300 + shift, 250);
    glEnd();

    glColor3ub(205, 133, 63);
    glBegin(GL_POLYGON);
    glVertex2d(325 + shift, 250);
    glVertex2d(400 + shift, 250);
    glVertex2d(390 + shift, 280);
    glVertex2d(335 + shift, 280);
    glEnd();

    glColor3ub(160, 82, 45);
    glBegin(GL_POLYGON);
    glVertex2d(360 + shift, 280);
    glVertex2d(370 + shift, 280);
    glVertex2d(370 + shift, 310);
    glVertex2d(360 + shift, 310);
    glEnd();

    glColor3ub(34, 139, 34);
    glBegin(GL_POLYGON);
    glVertex2d(335 + shift, 290);
    glVertex2d(390 + shift, 290);
    glVertex2d(390 + shift, 375);
    glVertex2d(335 + shift, 375);
    glEnd();

    glColor3ub(255, 0, 0);
    circle(15, 20, 362 + shift, 330);

    // Sun design
    glColor3ub(255, 215, 0);
    circle(25, 30, 175, 450);

    clouds();

    glFlush();
    glutSwapBuffers();
}

/* function to make the user able to deal with the system */
void key(int key, int x, int y)
{
    switch (key)
    {
    case GLUT_KEY_LEFT:
        shift -= 5;
        glutPostRedisplay();
        break;
    case GLUT_KEY_RIGHT:
        shift += 5;
        glutPostRedisplay();
        break;
    }
}

int main(int argc, char **argv)
{
    glutInit(&argc, argv);
    glutInitDisplayMode(GLUT_SINGLE | GLUT_RGB);
    glutInitWindowSize(1000, 600);
    glutInitWindowPosition(100, 100);
    glutCreateWindow("A Moving Boat");
    init();
    glutDisplayFunc(display);
    glutSpecialFunc(key);
    glutMainLoop();
    return 0;
}

