class Trie
{
public:
    Trie *children[2];
    int zeroes, ones;
    Trie()
    {
        children[0] = children[1] = nullptr;
        zeroes = 0;
        ones = 0;
    }
    void insert(int n)
    {
        Trie *node = this;
        for (int i = 22; i >= 0; i--)
        {
            bool mask = (n >> i) & (1);

            mask ? node->ones++ : node->zeroes++;

            if (node->children[mask] == nullptr)
            {
                node->children[mask] = new Trie();
            }
            node = node->children[mask];
        }
    }
    int answer(int n)
    {
        Trie *node = this;
        int maxi = 0;

        for (int i = 22; i >= 0; i--)
        {
            bool mask = (n >> i) & (1);

            if (node->children[mask ^ 1] != nullptr)
            {
                maxi |= (1LL << i);
                node = node->children[mask ^ 1];
            }
            else
            {
                node = node->children[mask];
            }
        }
        return maxi;
    }
    void remove(int n)
    {
        Trie *node = this;
        for (int i = 22; i >= 0; i--)
        {
            bool mask = (n >> i) & (1);
            if (mask)
            {
                node->ones--;
                if (node->ones == 0)
                {
                    node->children[1] = nullptr;
                    return;
                }
                else
                {
                    node = node->children[1];
                }
            }
            else
            {
                node->zeroes--;
                if (node->zeroes == 0)
                {
                    node->children[0] = nullptr;
                    return;
                }
                else
                {
                    node = node->children[0];
                }
            }
        }
    }
    bool search(int n)
    {
        Trie *node = this;
        for (int i = 22; i >= 0; i--)
        {
            bool mask = (n >> i) & (1);
            if (node->children[mask] == nullptr)
            {
                return false;
            }
            node = node->children[mask];
        }
        return true;
    }
};
class Solution
{
public:
    int maximumStrongPairXor(vector<int> &v)
    {
        // x >= y && x <= 2*y
        sort(v.begin(), v.end());
        int n = v.size();
        int i = n - 1, j = n - 1;
        Trie trie;
        int ans = 0;
        while (i >= 0 && j >= 0)
        {
            while ((v[j] <= (2 * v[i])) && (i >= 0))
            {
                trie.insert(v[i--]);
                ans = max(ans, trie.answer(v[j]));
            }
            trie.remove(v[j--]);
        }
        return ans;
    }
};

